INSERT INTO public."Equipment" VALUES (8, 'Equipo 8', 1, 5, 'Modelo-353', 'SER-8A9EF095', 'Area 2', 'Marca Genérica', 'Verificar que el robot esté encendido, comprobar la conexión eléctrica y cables de alimentación, revisar que no haya obstrucciones en las áreas de soldadura, confirmar el estado de los sensores y que los niveles de gas y material estén correctos.', 'Sistema 1', '2024-12-17 18:11:31.017', '2024-12-20 16:24:07.3', false, 'Sin Comentarios', '{}');
INSERT INTO public."Equipment" VALUES (12, 'Equipo 12', 2, 6, 'Modelo-814', 'SER-0F7BAFD2', 'Area 2', 'Marca Genérica', 'Verificar la conexión eléctrica, comprobar el nivel de lubricante, revisar que no haya materiales atascados en la herramienta, asegurar que las cuchillas estén en buen estado, y confirmar que los controles y botones de seguridad funcionen correctamente.', 'Sistema 2', '2024-12-17 18:11:34.727', '2024-12-20 16:24:07.3', false, 'Sin Comentarios', '{}');
INSERT INTO public."Equipment" VALUES (13, 'Equipo 13', 2, 6, 'Modelo-943', 'SER-BA9757AD', 'Area 2', 'Marca Genérica', 'Verificar la conexión eléctrica, comprobar que no haya objetos atascados en la cinta, revisar el estado de los rodillos y la tensión de la banda, asegurarse de que los motores no emitan ruidos extraños y confirmar que los sensores de inicio y paro funcionen correctamente.  ', 'Sistema 2', '2024-12-17 18:11:35.654', '2024-12-20 16:24:07.3', false, 'Sin Comentarios', '{}');
INSERT INTO public."Equipment" VALUES (22, 'Equipo 22', 3, 4, 'Modelo-398', 'SER-029CD965', 'Area 1', 'Marca Genérica', 'Verificar el nivel de combustible o carga de batería, comprobar el estado de los neumáticos, revisar el funcionamiento de los frenos y luces, asegurarse de que no haya fugas de fluidos, y confirmar que los controles y la bocina funcionen correctamente.', 'Sistema 1', '2024-12-17 18:11:44.156', '2024-12-20 16:24:07.3', false, 'Sin Comentarios', '{}');
INSERT INTO public."Equipment" VALUES (19, 'Equipo 19', 3, 3, 'Modelo-359', 'SER-D9FE9046', 'Area 2', 'Marca Genérica', 'Verificar la conexión eléctrica y el estado de los cables, comprobar que no haya materiales atascados, revisar el nivel de lubricante, confirmar que los sensores y botones de control funcionen, y asegurarse de que no haya ruidos inusuales durante la operación.', 'Sistema 2', '2024-12-17 18:11:41.375', '2024-12-20 16:24:07.3', false, 'Sin Comentarios', '{"{\"userId\": 10, \"changes\": [{\"field\": \"extra\", \"newValue\": \"Verificar la conexión eléctrica y el estado de los cables, comprobar que no haya materiales atascados, revisar el nivel de lubricante, confirmar que los sensores y botones de control funcionen, y asegurarse de que no haya ruidos inusuales durante la operación.\", \"oldValue\": null}], \"username\": \"admin\", \"timestamp\": \"2024-12-17T19:30:53.392Z\"}"}');
INSERT INTO public."Equipment" VALUES (23, 'Equipo 23', 3, 5, 'Modelo-370', 'SER-AEE1FD2B', 'Area 2', 'Marca Genérica', 'Verificar el nivel de combustible o carga de batería, comprobar el estado de los neumáticos, revisar el funcionamiento de los frenos y luces, asegurarse de que no haya fugas de fluidos, y confirmar que los controles y la bocina funcionen correctamente.', 'Sistema 2', '2024-12-17 18:11:45.083', '2024-12-20 16:24:07.3', false, 'Sin Comentarios', '{}');
